import React from "react";

export default function VideoCard(){
    return(
        <div className="video-card">
            <iframe width="560" height="315" src="https://www.youtube.com/embed/ihlHY-kunpA" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}
